fun main(args: Array<String>) {
  val data = listOf("",
      "",
      "",
      "",
      "")

  var solution =""
  var number = 5
  for (line in data) {
    line.forEach {
      when (it) {
        'U' -> {
          if (number > 3) number -= 3
        }
        'D' -> {
          if (number < 7) number += 3
        }
        'L' -> {
          if (number % 3 != 1 && number > 1) number -= 1
        }
        'R' -> {
          if (number % 3 != 0 && number < 9) number += 1
        }
      }
    }
    solution += number
  }
  println(solution)
}